import React, { Component, Fragment } from 'react';
import './style.css';
import starSky from './img/starSky.png';


class Main extends Component {
    render() {
        return (
            <Fragment>
                <div className="firstPage">
                    <div className="star"><img src={starSky} alt=""/></div>
                    <div className="linerColor"></div>
                </div>
            </Fragment>
        )
    }
}

export default Main;
